import React, { Component } from "react";
import { HomeWrapper, HomeLeft, HomeRight } from "./style";
class Home extends Component {
  render() {
    return (
      <HomeWrapper>
        <HomeLeft>1</HomeLeft>
        <HomeRight>2</HomeRight>
      </HomeWrapper>
    );
  }
}

export default Home;
